import React from 'react';
import ReactDOM from 'react-dom'
class Footer extends Component{
  constructor(props){
    super(props);
    this.state={
      name:'hai',
    };
  }
  render(){
    return(<>
    <div>{this.state}</div>
    </>);
  }
}
export default Footer;
